import React from 'react';
import { Link } from 'react-router-dom';
import homeImage from '../public/home.gif';
import whalogo from '../public/whalogo.png';

const Home = () => {
    return (
        <div className="home-container">
            <div className="home-image">
                <img src={homeImage} alt="Home" />
            </div>
            <div className="whatsapp-button">
                <a href="https://wa.me/62318361" target="_blank" rel="noopener noreferrer">
                    <img src={whalogo} alt="WhatsApp" />
                </a>
            </div>
            <div className="products-button">
                <Link to="/products">
                    <button>Mira nuestros productos</button>
                </Link>
            </div>
        </div>
    );
}

export default Home;
